$(document).on('click', '#create-mechanic-submit-btn', checkCreateMechanicPassword);
$(document).on('click', '#show-deleted-emails', showDeletedEmails);
showDEmails();

function checkCreateMechanicPassword(e) {
  e.preventDefault();
  var name = $('#create-mechanic-name');
  var email = $('#create-mechanic-email');
  var password = $('#create-mechanic-password');
  var confirmPassword = $('#create-mechanic-confirm-password');
  var errorLabel = $('#create-mechanic-error-label');

  if (name.val() || email.val()) {
    if (password.val() !== confirmPassword.val()) {
      errorLabel.text('-Wrong Password');
      confirmPassword.addClass('border-danger');
      password.addClass('border-danger');
    } else if (!password.val() || !confirmPassword.val()) {
      errorLabel.text('-You must fill both password fields');
      confirmPassword.addClass('border-danger');
      password.addClass('border-danger');
    } else {
      $('#create-mechanic-form').submit();
    }
  } else {
    errorLabel.text('-All fields must be filled!!!');
  }
}

function addItemToGarage() {
  var chooseTemplate = $(this).attr('data-template');
  var addItem = $($(chooseTemplate).html());
  var clicked = dataArray[$(this).attr('data-times-clicked')] += 1;
  addItem.find('.add-to-garage').map(function (index, element) {
    return $(element).attr('name', $(element).attr('name') + "[".concat(clicked, "]"));
  });
  var target = $(this).attr('data-target');
  $(target).append(addItem);
}

function showDEmails() {
  var cBox = $('#show-deleted-emails');
  var target = cBox.attr('data-target');

  if ($(cBox).is(':checked')) {
    $(target).show();
  } else {
    $(target).hide();
  }
}

function showDeletedEmails() {
  var target = $(this).attr('data-target');

  if ($(this).is(':checked')) {
    $(target).show();
  } else {
    $(target).hide();
  }
}

function removeFromGarage() {
  var input = $(this).closest('.deleteContent');
  input.toggle('slide', function () {
    input.remove();
  });
}

